import React, { Component } from 'react';

import Jumbotron from 'react-bootstrap/Jumbotron';
import Container from 'react-bootstrap'

export default class Home extends Component {
    render() {
        return (<div>

            <Jumbotron fluid>
               <Container>
                    <h1>TAKEBUG ;)</h1>
                    <p>
                    Seja bem vindo!
                    </p>
                    </Container>
            </Jumbotron>

            </div>);
    }
}
